{
  "translationLines": [
    {
      "lineNumber": 201342,
      "originalJapaneseLine": "「すまないが、僕も慣れてるわけじゃないからね。",
      "translatedEnglishLine": "\"Sorry, but I'm not really used to it either.\""
    },
    {
      "lineNumber": 201343,
      "originalJapaneseLine": "　リセットやロッキーさんの食事のように",
      "translatedEnglishLine": "Like Reset's or Rocky's meals,"
    },
    {
      "lineNumber": 201344,
      "originalJapaneseLine": "　美味しくないかも知れないよ」",
      "translatedEnglishLine": "it might not be delicious.\""
    },
    {
      "lineNumber": 201345,
      "originalJapaneseLine": "一口食べた途端、",
      "translatedEnglishLine": "The moment you took a bite,"
    },
    {
      "lineNumber": 201346,
      "originalJapaneseLine": "乱義の言葉が謙遜であることをあなたは知った。",
      "translatedEnglishLine": "you realized that Rangii's words were modesty."
    },
    {
      "lineNumber": 201347,
      "originalJapaneseLine": "あなたは素直な感想を乱義に述べた。",
      "translatedEnglishLine": "You honestly gave your impression to Rangii."
    },
    {
      "lineNumber": 201348,
      "originalJapaneseLine": "「……ん、そうかい？」",
      "translatedEnglishLine": "\"...Hmm, is that so?\""
    },
    {
      "lineNumber": 201349,
      "originalJapaneseLine": "「それは良かった」",
      "translatedEnglishLine": "\"That's good to hear.\""
    },
    {
      "lineNumber": 201350,
      "originalJapaneseLine": "褒められて乱義も悪い気はしていないようだった。",
      "translatedEnglishLine": "Rangii seemed to not feel bad about being praised."
    },
    {
      "lineNumber": 201351,
      "originalJapaneseLine": "「ふう……」",
      "translatedEnglishLine": "\"Phew...\""
    },
    {
      "lineNumber": 201352,
      "originalJapaneseLine": "箸を置いて乱義が景色を眺める。",
      "translatedEnglishLine": "Rangii put down his chopsticks and gazed at the scenery."
    },
    {
      "lineNumber": 201353,
      "originalJapaneseLine": "「たまにはこういうのんびりした日も悪くないね」",
      "translatedEnglishLine": "\"Sometimes a relaxed day like this isn't so bad.\""
    },
    {
      "lineNumber": 201354,
      "originalJapaneseLine": "あなた達は美味しく昼ご飯を食べた。",
      "translatedEnglishLine": "You all enjoyed a delicious lunch."
    },
    {
      "lineNumber": 201355,
      "originalJapaneseLine": "「もぐもぐ、もぐもぐ。うん。",
      "translatedEnglishLine": "\"Munch munch, munch munch. Yeah."
    },
    {
      "lineNumber": 201356,
      "originalJapaneseLine": "　おいひぃ、おいひぃ……」",
      "translatedEnglishLine": "\"Yummy, yummy...\""
    },
    {
      "lineNumber": 201357,
      "originalJapaneseLine": "あなたが宿屋で作っておいたお弁当を、",
      "translatedEnglishLine": "Fukane happily ate the lunchbox you had prepared at the inn,"
    },
    {
      "lineNumber": 201358,
      "originalJapaneseLine": "深根は嬉しそうにパクパクと食べていた。",
      "translatedEnglishLine": "munching away happily."
    },
    {
      "lineNumber": 201359,
      "originalJapaneseLine": "「んふーっ……",
      "translatedEnglishLine": "\"Nfu~...\""
    },
    {
      "lineNumber": 201360,
      "originalJapaneseLine": "　ごちそうさまでした」",
      "translatedEnglishLine": "\"Thank you for the meal.\""
    },
    {
      "lineNumber": 201361,
      "originalJapaneseLine": "「さ、＜エール＞ちゃん」",
      "translatedEnglishLine": "\"Now then, <Elle>-chan\""
    },
    {
      "lineNumber": 201362,
      "originalJapaneseLine": "深根は前触れもなくあなたにのしかかると、",
      "translatedEnglishLine": "Without warning, Fukane climbed onto you,"
    },
    {
      "lineNumber": 201363,
      "originalJapaneseLine": "ぐいーーーっと体を押し倒そうとしてきた。",
      "translatedEnglishLine": "and tried to push your body down forcefully."
    },
    {
      "lineNumber": 201364,
      "originalJapaneseLine": "「昼寝、しよ？」",
      "translatedEnglishLine": "\"Let's take a nap, okay?\""
    },
    {
      "lineNumber": 201365,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": " "
    },
    {
      "lineNumber": 201366,
      "originalJapaneseLine": "　　＜ぐいーーーーーっ＞",
      "translatedEnglishLine": "  <pushhhhh>"
    },
    {
      "lineNumber": 201367,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\"............\""
    },
    {
      "lineNumber": 201368,
      "originalJapaneseLine": "あなたは深根に押し倒されてしまう。",
      "translatedEnglishLine": "You were pushed down by Fukane."
    },
    {
      "lineNumber": 201369,
      "originalJapaneseLine": "背中の雲がふわふわと柔らかかった。",
      "translatedEnglishLine": "The cloud on her back was fluffy and soft."
    },
    {
      "lineNumber": 201370,
      "originalJapaneseLine": "「んふーーっ……」",
      "translatedEnglishLine": "\"Nfu~...\""
    },
    {
      "lineNumber": 201371,
      "originalJapaneseLine": "「じゃ、お休み、＜エール＞ちゃん」",
      "translatedEnglishLine": "\"Well then, good night, <Elle>-chan.\""
    },
    {
      "lineNumber": 201372,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"............\""
    },
    {
      "lineNumber": 201373,
      "originalJapaneseLine": "「……すやすや」",
      "translatedEnglishLine": "\"...sleeping peacefully\""
    },
    {
      "lineNumber": 201374,
      "originalJapaneseLine": "深根はあなたの体の上に寝転がって",
      "translatedEnglishLine": "Fukane lay down on your body"
    },
    {
      "lineNumber": 201375,
      "originalJapaneseLine": "まるでにゃんにゃんのように眠ってしまった。",
      "translatedEnglishLine": "and fell asleep just like a little cat."
    },
    {
      "lineNumber": 201376,
      "originalJapaneseLine": "ポカポカとした陽気にあなたの瞼も自然と重くなる。",
      "translatedEnglishLine": "The warm sunny weather made your eyelids naturally grow heavy."
    },
    {
      "lineNumber": 201377,
      "originalJapaneseLine": "あなた達は一時間だけ穏やかに昼寝して過ごした。",
      "translatedEnglishLine": "You all spent a peaceful hour taking a nap."
    },
    {
      "lineNumber": 201378,
      "originalJapaneseLine": "「さ、お昼にしましょう。",
      "translatedEnglishLine": "\"Now, let's have lunch."
    },
    {
      "lineNumber": 201379,
      "originalJapaneseLine": "　はい、これ。お弁当」",
      "translatedEnglishLine": "Here, this is your lunchbox.\""
    },
    {
      "lineNumber": 201380,
      "originalJapaneseLine": "あなたは可愛い女の子用のお弁当箱を渡された。",
      "translatedEnglishLine": "You were handed a cute lunchbox for a girl."
    },
    {
      "lineNumber": 201381,
      "originalJapaneseLine": "「あに不思議そうな顔をしてるのよ。",
      "translatedEnglishLine": "\"Why do you have such a puzzled look on your face?"
    },
    {
      "lineNumber": 201382,
      "originalJapaneseLine": "　あたしが弁当作ってきたってのがそんな意外？」",
      "translatedEnglishLine": "Is it so surprising that I made the lunch?\""
    },
    {
      "lineNumber": 201383,
      "originalJapaneseLine": "「嫌なら別に食べなくてもいいのよ？」",
      "translatedEnglishLine": "\"If you don't like it, you don't have to eat it, you know?\""
    },
    {
      "lineNumber": 201384,
      "originalJapaneseLine": "あなたは首を横に振って、",
      "translatedEnglishLine": "You shook your head side to side,"
    },
    {
      "lineNumber": 201385,
      "originalJapaneseLine": "お弁当箱を受け取った。",
      "translatedEnglishLine": "and accepted the lunchbox."
    },
    {
      "lineNumber": 201386,
      "originalJapaneseLine": "お弁当の中は思ったよりも、",
      "translatedEnglishLine": "Inside the lunchbox, more than you expected,"
    },
    {
      "lineNumber": 201387,
      "originalJapaneseLine": "彩り鮮やかで賑やかなお弁当だった。",
      "translatedEnglishLine": "it was a colorful and lively lunch."
    },
    {
      "lineNumber": 201388,
      "originalJapaneseLine": "強いて不満を漏らすなら肉がないことだけだろうか。",
      "translatedEnglishLine": "If you had to complain, it would only be that there was no meat."
    },
    {
      "lineNumber": 201389,
      "originalJapaneseLine": "一口食べると、",
      "translatedEnglishLine": "Taking a bite,"
    },
    {
      "lineNumber": 201390,
      "originalJapaneseLine": "味もとても良いことがすぐに分かった。",
      "translatedEnglishLine": "you immediately realized it tasted very good."
    },
    {
      "lineNumber": 201391,
      "originalJapaneseLine": "「美味しい？」",
      "translatedEnglishLine": "\"Is it delicious?\""
    },
    {
      "lineNumber": 201392,
      "originalJapaneseLine": "あなたは素直にこくこくと頷く。",
      "translatedEnglishLine": "You nodded honestly."
    },
    {
      "lineNumber": 201393,
      "originalJapaneseLine": "「そっ」",
      "translatedEnglishLine": "\"I see.\""
    },
    {
      "lineNumber": 201394,
      "originalJapaneseLine": "素っ気なくそう言って、",
      "translatedEnglishLine": "Saying that curtly,"
    },
    {
      "lineNumber": 201395,
      "originalJapaneseLine": "ミックスはデザートのリンゴを先にパキンと食べた。",
      "translatedEnglishLine": "Mix bit into the dessert apple first with a crisp snap."
    },
    {
      "lineNumber": 201396,
      "originalJapaneseLine": "「……まるでピクニックねぇ」",
      "translatedEnglishLine": "\"...It's just like a picnic.\""
    },
    {
      "lineNumber": 201397,
      "originalJapaneseLine": "「食事終わったら、あたし、少し寝るわ」",
      "translatedEnglishLine": "\"When we finish eating, I'll take a little nap.\""
    },
    {
      "lineNumber": 201398,
      "originalJapaneseLine": "「いつも研究研究だからね……",
      "translatedEnglishLine": "\"It's always research, research, you know..."
    },
    {
      "lineNumber": 201399,
      "originalJapaneseLine": "　たまにくらいはいい、わよね……」",
      "translatedEnglishLine": "So it's okay to take a break once in a while, right...?\""
    },
    {
      "lineNumber": 201400,
      "originalJapaneseLine": "あなたはミックスと隣り合って食事し、",
      "translatedEnglishLine": "You ate side by side with Mix,"
    },
    {
      "lineNumber": 201401,
      "originalJapaneseLine": "のどかに昼寝を楽しんだ。",
      "translatedEnglishLine": "and enjoyed a peaceful afternoon nap."
    }
  ]
}

